Font Fallback and Weight Variations Test

        @font-face {
            font-family: 'Liberation Sans';
            src: url('../../font/LiberationSans-Regular.ttf') format('truetype');
            font-weight: 400;
            font-style: normal;
        }
        @font-face {
            font-family: 'Liberation Sans';
            src: url('../../font/LiberationSans-Bold.ttf') format('truetype');
            font-weight: 700;
            font-style: normal;
        }
        @font-face {
            font-family: 'Liberation Sans';
            src: url('../../font/LiberationSans-Italic.ttf') format('truetype');
            font-weight: 400;
            font-style: italic;
        }
        @font-face {
            font-family: 'Roboto';
            src: url('../../font/Roboto-Regular.ttf') format('truetype');
            font-weight: 400;
            font-style: normal;
        }
        @font-face {
            font-family: 'Roboto';
            src: url('../../font/Roboto-Bold.ttf') format('truetype');
            font-weight: 700;
            font-style: normal;
        }

        body {
            margin: 20px;
            background-color: white;
            color: black;
        }

        .test-section {
            margin: 20px 0;
            padding: 15px;
            border: 1px solid #ddd;
        }

        .primary-font {
            font-family: 'Liberation Sans', Arial, sans-serif;
            font-size: 16px;
            line-height: 1.5;
        }

        .fallback-test {
            font-family: 'NonExistentFont', 'Liberation Sans', Arial, sans-serif;
            font-size: 16px;
            line-height: 1.5;
        }

        .weight-100 { font-weight: 100; }
        .weight-200 { font-weight: 200; }
        .weight-300 { font-weight: 300; }
        .weight-400 { font-weight: 400; }
        .weight-500 { font-weight: 500; }
        .weight-600 { font-weight: 600; }
        .weight-700 { font-weight: 700; }
        .weight-800 { font-weight: 800; }
        .weight-900 { font-weight: 900; }

        .roboto-mixed {
            font-family: 'Roboto', 'Liberation Sans', system-ui, sans-serif;
            font-size: 16px;
            line-height: 1.5;
        }



    Font Fallback and Weight Variations Test


        Primary Font - Liberation Sans

            This text uses Liberation Sans as the primary font family with Arial as fallback. The quick brown fox jumps over the lazy dog.




        Fallback Test - NonExistent → Liberation Sans

            This text requests a non-existent font first, then falls back to Liberation Sans. The rendering should be identical to the previous example.




        Font Weight Variations (Liberation Sans)
        Font Weight 100 (Thin) - May fallback to regular
        Font Weight 200 (Extra Light) - May fallback to regular
        Font Weight 300 (Light) - May fallback to regular
        Font Weight 400 (Regular) - Should display correctly
        Font Weight 500 (Medium) - May display as bold
        Font Weight 600 (Semi Bold) - May display as bold
        Font Weight 700 (Bold) - Should display correctly
        Font Weight 800 (Extra Bold) - May display as bold
        Font Weight 900 (Black) - May display as bold



        Mixed Font Stack - Roboto + Liberation Sans

            Roboto Regular: This text should display in Roboto with Liberation Sans as fallback.


            Roboto Bold: This text should display in bold Roboto with bold Liberation Sans as fallback.




        Font Style Variations
        Normal style text
        Italic style text - should use Liberation Sans Italic
        Oblique style text - may synthesize from regular

